issue.body:
es版本: 7.2.1
elasticsearch-sql版本: 7.2.1

使用方法: 构建 **searchDao** 调用 **explain** 方法输出 dsl 语句

```
SearchDao searchDao = new SearchDao(null);
String dsl = searchDao.explain(sql).explain().explain();
System.out.printf("sql:%s --> dsl:%s%n",sql,dsl);
```

```
sql: select /*! TRACK_TOTAL_HITS(true) */ * from my_document LIMIT 0, 10 -->  dsl: {"from":0,"size":10}
```

其它版本正常
试了 7.6.2 7.12.0 7.14.0 都是正常输出
```
{
	"from": 0,
	"size": 10,
	"track_total_hits": 2147483647
}
```

